vec4 runtimeShader_FragColor;
vec2 runtimeShader_uv;
vec4 runtimeShader_FragCoord;
uniform mat3 u_matResolution;
// #version 300 es  // version directive is not needed in AGSL
// precision highp float;  // precision directive is not needed in AGSL
// @Texture(MainTex)=[1,1,0,0]
uniform shader u_texture;
uniform vec2 u_texture_size;
// @Range(u_time,0,10000,1)=0
uniform float u_time; 
// @Vec2(u_resolution,0.1)=[100,100]
uniform vec2 u_resolution;
// @Range(BaseA,0.0,23.0,0.1)=0.0
uniform float BaseA; 
// @Range(Glow,0.01,0.2,0.01)=0.01
uniform float glow;
// @Range(centerx,0.0,1.0,0.001)=0.5
uniform float centerx; 
// @Range(centery,0.0,1.0,0.001)=0.5
uniform float centery; 
// @Range(margin, 0.0, 512.0, 1.0)=243
uniform float margin;
// @Range(marginAlpha, 0.0, 1.0, 0.01)=0.25
uniform float marginAlpha;
// @Vec2(buttonSize,0.1)=[111,111]
uniform vec2 buttonSize;
// @Range(buttonCorner, 0.0, 256.0, 1.0)=64
uniform float buttonCorner;
// @Color(lightColor,0.01)=[0.1,1,0.3,1]
uniform vec4 lightColor;

// in vec2 runtimeShader_uv;
// out vec4 runtimeShader_FragColor;

float sdCircle( vec2 p, float r )
{
    return length(p) - r;
}

float sdRoundedBox( in vec2 p, in vec2 b, in vec4 r )
{
    r.xy = (p.x>0.0)?r.xy : r.zw;
    r.x  = (p.y>0.0)?r.x  : r.y;
    vec2 q = abs(p)-b+r.x;
    return min(max(q.x,q.y),0.0) + length(max(q,0.0)) - r.x;
}

vec4 main(vec2 FragCoord) {
    runtimeShader_FragCoord = vec4(FragCoord, 0.0, 1.0);
    runtimeShader_uv = FragCoord / u_resolution.xy;
    vec2 p = runtimeShader_FragCoord.xy - vec2(centerx, centery) * u_resolution.xy;

    float sdf = sdRoundedBox(p, buttonSize * 0.5, vec4(buttonCorner));

    vec4 tex = u_texture.eval(runtimeShader_FragCoord.xy);  
    runtimeShader_FragColor = tex;
    float dr = marginAlpha * smoothstep(margin,0.0, sdf)*step(0.0,sdf) ;
    runtimeShader_FragColor.rgb += vec3(dr * lightColor.rgb * lightColor.a) * tex.a;

    return runtimeShader_FragColor;

}
